import React, { useState } from "react";
import { Button, styled } from "reakit";
import { Colors, Size, Fonts, style } from "../../assets/common/Styles";

const Label = styled.label`
  padding: 0.2rem;
  text-transform: uppercase;
  color: ${Colors.DustGray};
  font-weight: bold;
  font-size: ${Fonts.FontSize.small};
`;
const LoginForm = (props) => {
  return (
    <form>
      <label>
        Name:
        <input type="text" name="name" />
      </label>
      <Button
        id="Login"
        bgColor={style.Colors.GoldSand}
        padding="1em 0.2em"
        fontSize={style.Fonts.FontSize.medium}
        margin="0"
        text={"Join Club Live 100"}
        onClick={() => history.push(`${baseUrl}/auth/register`)}
      />
    </form>
  );
};

export default LoginForm;
